import '../styles/employerReg.css';
import { useState } from 'react';
import { SubmitHandler, useForm } from 'react-hook-form';
import { InputMask } from '@react-input/mask'
import { Link } from 'react-router-dom';

import { fetchData, employerRegApi, apiKey, employerEmailCheckApi } from '../utils/utils'

interface formData {
    companyName: string;
    companyEmail: string;
    addressZip: string;
    addressCity: string;
    address: string;
    taxNumber: string;
    industry_id: string;
    number_of_employees: string;
    contact_person_first_name: string;
    contact_person_last_name: string;
    country_code: string;
    phone_number: string;
    contact_person_position: string | number;
    terms_and_conditions: boolean;
    data_protection_terms: boolean;
    subscribes_to_newsletter: boolean;
};


/* Employer registration from */
const EmployerReg = () => {
    const { register, handleSubmit, formState: { errors }, getValues, setError, clearErrors, setValue } = useForm<formData>();
    const [message, setMessage] = useState<string>("");

    const onSubmit: SubmitHandler<formData> = async (data) => {

    };

    const checkEmailExists = async (email:string) => {

    };

    return (
        <div className="employerreg-container">
            <div className="border rounded p-3 mx-auto employerinnerreg-container">

                <div className="margin-custom">
                    <Link to='/'>
                        <img src="images/abovoLogo.svg" alt="Abovo logo" id="abovoLogo" />
                    </Link>
                </div>

                <h1 className="preregistration-form-title"> Cégadatok: </h1>

                <form onSubmit={handleSubmit(onSubmit)}>

                    <div className="form-group">
                        <label htmlFor="companyName"> Társaság megnevezése </label>
                        <input
                            type="text"
                            id="companyName"
                            placeholder='Xy kft.'
                            {...register("companyName", { 
                                required: "A cég neve nem lehet üres.",
                                maxLength: {
                                    value: 255,
                                    message: "A cég neve nem lehet 255 karakternél hosszabb."
                                }
                             })}
                            className={`form-control custom-input ${errors.companyName ? 'is-invalid' : ''}`}                          
                        />
                        {errors.companyName && <div className="invalid-feedback">{errors.companyName.message as string}</div>}
                    </div>

                    <div className="form-group">
                        <label htmlFor="companyEmail"> Társaság e-mail címe </label>
                            <input
                                type="email"
                                id="employeeEmail"
                                placeholder="horvathrenata@mail.com"
                                {...register("companyEmail", {required: "E-mail cím kötelező."})}
                                onBlur={() => checkEmailExists(getValues("companyEmail"))}
                                className={`form-control custom-input ${errors.companyEmail ? 'is-invalid' : ''}`}
                            />
                        {errors.companyEmail && <div className="invalid-feedback">{errors.companyEmail.message as string}</div>}
                    </div>

                    <div className="form-group">
                        <label htmlFor="addressZip"> Társaság megnevezése </label>
                        <input
                            type="text"
                            id="addressZip"
                            placeholder='1221'
                            {...register("addressZip", { 
                                required: "A cég neve nem lehet üres.",
                                maxLength: {
                                    value: 4,
                                    message: "A cég írányitószáma nem hosszabb rövidebb 4 karakternél."
                                },
                                minLength: {
                                    value: 4,
                                    message: "A cég írányitószáma nem lehet rövidebb 4 karakternél."
                                }
                             })}
                            className={`form-control custom-input ${errors.addressZip ? 'is-invalid' : ''}`}                          
                        />
                        {errors.addressZip && <div className="invalid-feedback">{errors.addressZip.message as string}</div>}
                    </div>

                    <div className="form-group">
                        <label htmlFor="addressCity"> Társaság megnevezése </label>
                        <input
                            type="text"
                            id="addressCity"
                            placeholder='Írd be'
                            {...register("addressCity", { 
                                required: "A város nem lehet üres.",
                                maxLength: {
                                    value: 255,
                                    message: "A város neve nem lehet 255 karakternél hosszabb."
                                }
                             })}
                            className={`form-control custom-input ${errors.addressCity ? 'is-invalid' : ''}`}                          
                        />
                        {errors.addressCity && <div className="invalid-feedback">{errors.addressCity.message as string}</div>}
                    </div>

                    <div className="form-group">
                        <label htmlFor="address"> Társaság megnevezése </label>
                        <input
                            type="text"
                            id="address"
                            placeholder='Fő utca 5/4'
                            {...register("address", { 
                                required: "A cím nem lehet üres.",
                                maxLength: {
                                    value: 255,
                                    message: "A cím neve nem lehet 255 karakternél hosszabb."
                                }
                             })}
                            className={`form-control custom-input ${errors.address ? 'is-invalid' : ''}`}                          
                        />
                        {errors.address && <div className="invalid-feedback">{errors.address.message as string}</div>}
                    </div>

                    <div className="form-group">
                        <label htmlFor="taxNumber">Adószám</label>
                        <InputMask
                            mask="99999999 - 9 - 99"
                            placeholder="11111111 - 1 - 11"
                            {...register("taxNumber", {
                                required: "A kód nem lehet üres.",
                                pattern: {
                                    value: /^\d{8} - \d - \d{2}$/,
                                    message: "A formátumnak 11111111 - 1 - 11 formátumúnak kell lennie."
                                }
                            })}
                            value={getValues("taxNumber")}  // Ensuring the value is synced with React Hook Form
                            onChange={(event) => {
                                // Ensure that React Hook Form can track changes
                                setValue("taxNumber", event.target.value, { shouldValidate: true });
                            }}
                            className={`form-control ${errors.taxNumber ? 'is-invalid' : ''}`}
                        />
                        {errors.taxNumber && <div className="invalid-feedback">{errors.taxNumber.message}</div>}
                    </div>


                </form>

            </div>
        </div>
    )
};

export default EmployerReg;
